class Solution:
    # @param {string} s
    # @param {string[]} words
    # @return {integer[]}
        #brute force is too slow
    def findSubstring(self, s, words):
        step, wn = len(words[0]), len(words)
        wd = {}
        result = []
        # create the word dict
        for i in words:
            wd[i] = wd.get(i, 0) + 1
        
        for i in xrange(step):
            sd = {}
            sn = 0
            start = i
            
            for j in xrange(i, len(s)-step+1, step):
                w = s[j:j+step]
                if w in wd:
                    # when w is a valid word, update string dict
                    sd[w] = sd.get(w, 0) + 1
                    sn += 1
                    
                    # if repeated words is more than required, begin to delete saving result, update the start point, until the count is equal to required. 
                    while sd[w] > wd[w]:
                        tmp = s[start:start+step]
                        sd[tmp] -= 1
                        sn -= 1
                        start += step
                    
                    # if number of object is enough, save the result, and move start point to next 
                    if sn == wn:
                        result.append(start)
                        tmp = s[start:start+step]
                        sd[tmp] -= 1
                        sn -= 1
                        start += step
                else:
                    sd = {}
                    sn = 0
                    start = j + step
                    
        return result
    
    
